        epInfo: [
            {id: "s12e1", title:"Keep Calm and Carry On",num: "1", photo: "/assets/episodes/season12/s12e1.jpg", description: "As Crowley conducts a desperate search for Lucifer's vessel, Dean must come to grips with an unbelievable sight: the return of his mother.", dir: "Phil Sgriccia", writ:"Andrew Dabb", aired:"10/13/2016"},
            {id: "s12e2", title:"Mamma Mia",num: "2", photo: "/assets/episodes/season12/s12e2.jpg", description: "A reluctant Dean brings Mary along on a mission to rescue Sam. Crowley receives word that Lucifer has possessed the body of an aging rock star.", dir: "Thomas J Wright", writ:"Brad Buckner and Eugenie Ross-Leming", aired:"10/20/216"},
            {id: "s12e3", title:"The Foundry",num: "3", photo: "/assets/episodes/season12/s12e3.jpg", description: "Mary and the boys explore an old house astir with the sounds of a crying baby. Cas is less than thrilled when he's forced to partner up with Crowley.", dir: "Robert Singer", writ:"Robert Berens", aired:"10/27/2016"},
            {id: "s12e4", title:"American Nightmare",num: "4", photo: "/assets/episodes/season12/s12e4.jpg", description: "After several victims are whipped to death by an unseen force, Sam and Dean begin to suspect a deeply religious family that lives off the grid.", dir: "John F Showalter", writ:"Davy Perez", aired:"11/03/2016"},
            {id: "s12e5", title:"The One You've Been Waiting For",num: "5", photo: "/assets/episodes/season12/s12e5.jpg", description: "Time ticks away as a clan of Nazi necromancers plot to unleash Adolf hilter's captive soul from an enchanted gold pocket watch.", dir: "Nina Lopez-Corrado", writ:"Meredith Glynn", aired:"11/10/2016"},
            {id: "s12e6", title:"Celebrating the Life of Asa Fox",num: "6", photo: "/assets/episodes/season12/s12e6.jpg", description: "An assortment of hunters gather to commemorate a fallen brother, but Sam and Dean soon realize that a demon has come to kill them all.", dir: "John Badham", writ:"Steve Yockey", aired:"11/17/2016"},
            {id: "s12e7", title:"Rock Never Dies",num: "7", photo: "/assets/episodes/season12/s12e7.jpg", description: "Castiel and Crowley close in on Lucifer as the fallen angel realizes his new rock-star vessel allows him to get fans to do whatever he wants.", dir: "Eduardo Sanchez", writ:"Robert Berens", aired:"12/01/2016"},
            {id: "s12e8", title:"LOTUS",num: "8", photo: "/assets/episodes/season12/s12e8.jpg", description: "Rowena and Winchesters join Castiel and Crowley when Lucifer's path of terror intensifies - and leads all the way to the White House.", dir: "Phil Sgriccia", writ:"Brad Buckner and Eugenie Ross-Leming", aired:"12/08/2016"},
            {id: "s12e9", title:"First Blood",num: "9", photo: "/assets/episodes/season12/s12e9.jpg", description: "Sam and Dean dessperately seek an escape route after being placed in a high-level government facility for attempting to assassinate the president.", dir: "Robert Singer", writ:"Andrew Dabb", aired:"01/26/2017"},
            {id: "s12e10",title:"Lily Sunder Has Some Regrets", num: "10", photo: "/assets/episodes/season12/s12e10.jpg", description: "A woman whose family was killed by code-following angels in the year 1901 is out for revenge in the present day, and Cas is next on her list.", dir: "Thomas J Wright", writ:"Steve Yockey", aired:"02/02/2017"},
            {id: "s12e11",title:"Regarding Dean", num: "11", photo: "/assets/episodes/season12/s12e11.jpg", description: "When Dean falls under a memory-erasing spell and rapidly loses his sense of self, Sam's only hope is Rowena and an ancient, powerful coven of witches.", dir: "John Badham", writ:"Meredith Glynn", aired:"02/09/2017"},
            {id: "s12e12",title:"Stuck in the Middle (With You)", num: "12", photo: "/assets/episodes/season12/s12e12.jpg", description: "Mary keeps her involvement with the British Men of letters a secret as she brings Sam and Dean in on a case. But a double-crossing changes everything.", dir: "Richard Speight Jr.", writ:"Davy Perez", aired:"02/16/2017"},
            {id: "s12e13",title:"Family Feud", num: "13", photo: "/assets/episodes/season12/s12e13.jpg", description: "Sam and Dean track down Crowley's son after realizing a murder at a museum is connected to the centuries-old sunken ship he should've been on.", dir: "PJ Pesce", writ:"Brad Buckner and Eugenie Ross-Leming", aired:"02/23/2017"},
            {id: "s12e14",title:"The Raid", num: "14", photo: "/assets/episodes/season12/s12e14.jpg", description: "With Mary's help, the British Men of Letters prepare to exterminate an entire vampire nest, forcing Sam and Dean to make some tough choices.", dir: "John MacCarthy", writ:"Robert Berens", aired:"03/02/2017"},
            {id: "s12e15",title:"Somewhere Between Heaven and Hell", num: "15", photo: "/assets/episodes/season12/s12e15.jpg", description: "The Winchesters must unravel a complicated case of a demonic deal gone wrong when an invisible hellhound claims a soul at a campsite.", dir: "Nina Lopez-Corrado", writ:"Davy Perez", aired:"03/09/2017"},
            {id: "s12e16",title:"Ladies Drink Free", num: "16", photo: "/assets/episodes/season12/s12e16.jpg", description: "Mick Davies tags along as the Winchesters hunt for a werewolf. But when a dear friend of theirs is bitten, all bets are off.", dir: "Amyn Kaderali", writ:"Meredith Glynn", aired:"03/30/2017"},
            {id: "s12e17",title:"The British Invasion", num: "17", photo: "/assets/episodes/season12/s12e17.jpg", description: "Mick is forced to confront his own disturbing past when Sam and Dean's search for Kelly Kline leads to a deadly disaster.", dir: "John F Showalter", writ:"Brad Buckner and Eugenie Ross-Leming", aired:"04/06/2017"},
            {id: "s12e18",title:"The Memory Remains", num: "18", photo: "/assets/episodes/season12/s12e18.jpg", description: "Sam and Dean visit a small town where yearly disappearances once connected to a legendary goat-headed killer seem to have resumed.", dir: "Phil Sgriccia", writ:"John Bring", aired:"04/12/2017"},
            {id: "s12e19",title:"The Future", num: "19", photo: "/assets/episodes/season12/s12e19.jpg", description: "Kelly makes a difficult decision about Lucifer's unborn child, but it may not be hers to make. Castiel formulates a plan for the demonic baby.", dir: "Amanda Tapping", writ:"Robert Berens and Meredith Glynn", aired:"04/27/2017"},
            {id: "s12e20",title:"Twigs & Twine & Tasha Banes", num: "20", photo: "/assets/episodes/season12/s12e20.jpg", description: "The Winchesters help twin-sibling hunters look for their mother, who went missing while hunting a witch. Mary grows suspicious of the Men of Letters.", dir: "Richard Speight Jr.", writ:"Steve Yockey", aired:"05/04/2017"},
            {id: "s12e21",title:"There's Something About Mary", num: "21", photo: "/assets/episodes/season12/s12e21.jpg", description: "Sam and Dean race to locate Mary after realizing an ongoing rash of hunter deaths across the country is no accident.", dir: "PJ Pesce", writ:"Brad Buckner and Eugenie Ross-Leming", aired:"05/11/2017"},
            {id: "s12e22",title:"Who We Are", num: "22", photo: "/assets/episodes/season12/s12e22.jpg", description: "Sam and Dean must fall back on their undying trust for one another when they're caught in a war between the British and American hunters.", dir: "John F Showalter", writ:"Robert Berens", aired:"05/18/2017"},
            {id: "s12e23",title:"All Along the Watchtower", num: "22", photo: "/assets/episodes/season12/s12e23.jpg", description: "Sam, Dean, and Castiel may be the last line of defense between a powerful Lucifer and his unborn child.", dir: "Robert Singer", writ:"Andrew Dabb", aired:"05/18/2017"},
        ]
