        epInfo: [
            {id: "s15e1", title:"Back to the Future",num: "1", photo: "/assets/episodes/season15/s15e1.jpg", description: "Sam, Dean and Castiel reluctantly team up with a demon inhabiting Jack's body to battle an army of undead souls that includes some infamous killers.", dir: "John F Showalter", writ:"Andrew Dabb", aired:"10/10/2019"},
            {id: "s15e2", title:"Raising Hell",num: "2", photo: "/assets/episodes/season15/s15e2.jpg", description: "The Winchesters get some much-needed reinforcements as they try to ward off evil spirits from a small Kansas town. Chuck seeks out Amara in Reno.", dir: "Robert Singer", writ:"Brad Buckner and Eugenie Ross-Leming", aired:"10/17/2019"},
            {id: "s15e3", title:"The Rupture",num: "3", photo: "/assets/episodes/season15/s15e3.jpg", description: "With their defenses crumbling, Sam, Dean, Castiel and Rowena take bold steps to send the spirits back to hell- but their efforts come at a high price.", dir: "Charles Beeson", writ:"Robert Berens", aired:"10/24/2019"},
            {id: "s15e4", title:"Atomic Monsters",num: "4", photo: "/assets/episodes/season15/s15e4.jpg", description: "Sam and Dean head to Iowa to investigate some gruesome killings, which they suspect are the work of a vampire. Chuck reconnects with an old flame.", dir: "Jensen Ackles", writ:"Davy Perez", aired:"11/07/2019"},
            {id: "s15e5", title:"Proverbs 17:3",num: "5", photo: "/assets/episodes/season15/s15e5.jpg", description: "When several campers meet a grisly fate in colorado, Sam and Dean discover a werewolf presence- and have an unexpected run-in with an old foe.", dir: "Richard Speight Jr.", writ:"Steve Yockey", aired:"11/14/2019"},
            {id: "s15e6", title:"Golden Time",num: "6", photo: "/assets/episodes/season15/s15e6.jpg", description: "Sam's efforts to help Eileen entail a trip to Rowena's old place, where an ambush awaits. Castiel goes it alone as he works the case of a missing boy.", dir: "John F Showalter", writ:"Meredith Glynn", aired:"11/21/2019"},
            {id: "s15e7", title:"Last Call",num: "7", photo: "/assets/episodes/season15/s15e7.jpg", description: "Dean heads to Texas to investigate a woman's disappearance and runs into a long-lost friend. Sam learns that a persistent wound may hold deep secrets.", dir: "Amyn Kaderali", writ:"Jeremy Adams", aired:"12/05/2019"},
            {id: "s15e8", title:"Our Father, Who Aren't in Heaven",num: "8", photo: "/assets/episodes/season15/s15e8.jpg", description: "A revelation from the demon tablet sends Dean, Sam, and Castiel on a search mission in hell, where they have a surprising reunion.", dir: "Richard Speight Jr.", writ:"Brad Buckner and Eugenie Ross-Leming", aired:"12/12/2019"},
            {id: "s15e9", title:"The Trap",num: "9", photo: "/assets/episodes/season15/s15e9.jpg", description: "As a captive Sam endures horrid visions intended to break his spirit, Castiel and Dean venture to purgatory to find a key element for defeating Chuck.", dir: "Robert Singer", writ:"Robert Berens", aired:"01/16/2020"},
            {id: "s15e10", title:"The Heroes' Journey",num: "10", photo: "/assets/episodes/season15/s15e10.jpg", description: "The Winchesters are Wisconsin-bound to help an old friend, where they discover a very unique fight club- and wind up in need of some help themselves.", dir: "John F Showalter", writ:"Andrew Dabb", aired:"01/23/2020"},
            {id: "s15e11", title:"The Gamblers",num: "11", photo: "/assets/episodes/season15/s15e11.jpg", description: "Sam and Dean follow a lead to Alaska, where they play high-stakes games of chance. Castiel's pursuit of a lead of his own results in a reconnection.", dir: "Charles Beeson", writ:"Davy Perez and Meredith Glynn", aired:"01/30/2020"},
            {id: "s15e12", title:"Galaxy Brain",num: "12", photo: "/assets/episodes/season15/s15e12.jpg", description: "As Chuck takes drastic action, Sam and Dean answer a distress call in Sioux Falls that sets them on a course to somewhere else entirely: the Bad Place", dir: "Richard Speight Jr.", writ:"Robert Berens and Meredith Glynn", aired:"03/16/2020"},
            {id: "s15e13", title:"Destiny's Child",num: "13", photo: "/assets/episodes/season15/s15e13.jpg", description: "Sam and Dean's search for a crucial asset to Billie's plan leads them to some familiar places and faces. Castiel, with Jack's help, takes a bold step.", dir: "Amyn Kaderali", writ:"Brad Buckner and Eugenie Ross-Leming", aired:"03/23/2020"},
            {id: "s15e14", title:"Last Holiday",num: "14", photo: "/assets/episodes/season15/s15e14.jpg", description: "Dean accidentally releases a wood nymph in the bunker named Mrs. Butters, who proves to be super helpful, but she doesn't take so kindly to Jack.", dir: "Eduardo Sanchez", writ:"Jeremy Carver", aired:"10/08/2020"},
            {id: "s15e15", title:"Gimme Shelter",num: "15", photo: "/assets/episodes/season15/s15e15.jpg", description: "While Jack and Castiel head to Missouri to investigate a murder involving a teddy bear, Sam and Dean take off for Atlantic City to try and find Amara.", dir: "Matt Cohen", writ:"Davy Perez", aired:"10/18/2020"},
            {id: "s15e16", title:"Drag Me Away (From You)",num: "16", photo: "/assets/episodes/season15/s15e16.jpg", description: "The murder of an old friend leads Sam and Dean to revisit the first case they ever worked and an evil entity they thought they'd killed years earlier.", dir: "Amyn Kaderali", writ:"Meghan Fitzmartin", aired:"10/22/2020"},
            {id: "s15e17", title:"Unity",num: "17", photo: "/assets/episodes/season15/s15e17.jpg", description: "Chuck returns to Earth and debates with Amara about whether the world is worth preserving. As Jack faces a big test, Sam and Dean do not see eye to eye.", dir: "Catriona McKenzie", writ:"Meredith Glynn", aired:"10/29/2020"},
            {id: "s15e18", title:"Despair",num: "18", photo: "/assets/episodes/season15/s15e18.jpg", description: "Sam, Dean, and Castiel get unexpected help as they try to save Jack, then rush to stop a series of vanishings. But their efforts come at a big price.", dir: "Richard Speight Jr.", writ:"Robert Berens", aired:"11/05/2020"},
            {id: "s15e19", title:"Inherit the Earth",num: "19", photo: "/assets/episodes/season15/s15e19.jpg", description: "Sam, Dean and Jack face the vacant world Chuck has left them with, which they seem powerless to fix. But giving up has never been the Winchesters' way.", dir: "John F Showalter", writ:"Brad Buckner and Eugenie Ross-Leming", aired:"11/12/2020"},
            {id: "s15e20", title:"Carry On",num: "20", photo: "/assets/episodes/season15/s15e20.jpg", description: "In the series finale, Sam and Dean investigate one last case, then confront where their respective roads are going to take them next.", dir: "Robert Singer", writ:"Andrew Dabb", aired:"11/19/2020"},
        ]

